    B2Vec2.prototype.Angle = function () {
        return Math.atan2(this.x, -this.y) * 180 / Math.PI;
    };

    B2Vec2.prototype.DistanceTo = function (target) {
        return this.Copy().Subtract(target).Length();
    };

