cr.MyWorld = function MyWorld(gridWidth, gridHeight) {
    this.gridWidth = gridWidth;
    this.gridHeight = gridHeight;   
    this.agents = [];
    this.forts = [];
    this.bases = [];
    this.fences = [];
    this.obstacles = [];
    //new
    this.bullets = [];

    this.gameSetting = new cr.gameSetting();

    //log is killing while rolling, so kill action is defined in gameTick function.
    this.logKillVal = this.gameSetting.getAgentSetting("log").killVal;

    this.isStart = true;
    this.flowField = null;
    this.steerTimer = null;
    this.world = new B2World(B2Vec2.Zero, false);

    this.b2dSteerImp = new cr.b2dSteer();
    this.b2dSteerImp.setGridWidth(const_gridWidth);
    this.b2dSteerImp.setGridHeight(const_gridHeight);

    this.flowField = [];
    this.flowField = flowObj.flowField();
    this.reverseFlowField = [];
    this.reverseFlowField = rFlowObj.flowField();

    this.b2dSteerImp.setAgents(this.agents);
    this.b2dSteerImp.setFlowField(this.flowField);
    this.b2dSteerImp.setReverseFlowField(this.reverseFlowField);

    this.rollingLogBody = null;
    this.rollLogs = [];

    //this.intersect = cr.intersect();

    this.io = null;
    this.roomid = "";

    this.agentsTraceBack = new Array();
    this.bulletsTraceBack = new Array();
    this.basesTraceBack = new Array();
};

