cr.MyWorld.prototype.makeFences = function() {
    var x,y;
    //modified for NFT map
    for (var i = 0; i <= 15; i++) {
        this.fences.push(new B2Vec2(i, 0));
        this.fences.push(new B2Vec2(i, 34));
    }

    //modified for NFT map
    for (var j = 1; j < vertical_grids; j++) {
        this.fences.push(new B2Vec2(0, j));
        this.fences.push(new B2Vec2(1, j));
        this.fences.push(new B2Vec2(14, j));
        this.fences.push(new B2Vec2(15, j));
    }

    for (var i = 1; i < 16; i++) {
        //modified for NFT map
        if(i>=4 && i<=11) {
            continue;
        }

        //modified for NFT map
        for (var j = 16; j <= 18; j++) {
            x = i;
            y = j;
            this.fences.push(new B2Vec2(x, y));
        }
    }
    console.log("making fences");

    for (var i = 0; i < this.fences.length; i++) {
        baseAgent = new cr.Fence(this.world);
        var pos = this.fences[i];
        baseAgent.genBaseBody(pos);
    }    
}

