cr.MyWorld.prototype.freezeAct = function(isHero, pos, dura) {
    for(agent of this.agents) {
        if(agent.isHero !== isHero) {
            if(agent.corePosition().DistanceTo(pos) <= 2)  {
                //agent.body.SetActive(false);
                agent.setFreezeCounter(dura/(1000/60));   //60 is FPS, 1000/60 is one frame interval.
                agent.velocity().SetZero();
            }
        }
    }

    for(agent of this.bases) {
        if(agent.isHero !== isHero) {
            if(agent.corePosition().DistanceTo(pos) <= 2)  {
                agent.setFreezeCounter(dura/(1000/60));
            }
        }
    }

    for(agent of this.forts) {
        if(agent.isHero !== isHero) {
            if(agent.corePosition().DistanceTo(pos) <= 2)  {
                agent.setFreezeCounter(dura/(1000/60));
            }
        }
    }
};

cr.MyWorld.prototype.getBaseById = function(bid) {
    for(base of this.bases) {
        if(base.objectId == bid) {
            return base;
        }
    }
    return null;
};

