cr.MyWorld.prototype.regenMapFlow = function () {
    var objectId;
    var flowObj;
    var fileStr = "const_";
    var reverseFileStr = "const_r_";

    for (i = this.bases.length - 1; i >= 0; i--) {
        if(this.bases[i].objectId == 1) {
            fileStr = fileStr + 1;
            reverseFileStr = reverseFileStr + 1;
        }
    }
    for (i = this.bases.length - 1; i >= 0; i--) {
        if(this.bases[i].objectId == 2) {
            fileStr = fileStr + 2;
            reverseFileStr = reverseFileStr + 2;
        }
    }
    for (i = this.bases.length - 1; i >= 0; i--) {
        if(this.bases[i].objectId == 3) {
            fileStr = fileStr + 3;
            reverseFileStr = reverseFileStr + 3;
        }
    }

    fileStr = fileStr + "_";
    reverseFileStr = reverseFileStr + "_";

    for (i = this.bases.length - 1; i >= 0; i--) {
        if(this.bases[i].objectId == 4) {
            fileStr = fileStr + 4;
            reverseFileStr = reverseFileStr + 4;
        }
    }
    for (i = this.bases.length - 1; i >= 0; i--) {
        if(this.bases[i].objectId == 5) {
            fileStr = fileStr + 5;
            reverseFileStr = reverseFileStr + 5;
        }
    }
    for (i = this.bases.length - 1; i >= 0; i--) {
        if(this.bases[i].objectId == 6) {
            fileStr = fileStr + 6;
            reverseFileStr = reverseFileStr + 6;
        }
    }
    
    //const_123_456_flowJson const_123_45_flowJson
    fileStr += "_flowJson";
    reverseFileStr += "_flowJson";

    console.log(fileStr);
    console.log(reverseFileStr);

    flowObj = JSON.parse(eval(fileStr));
    reverseFlowObj = JSON.parse(eval(reverseFileStr));

    this.flowField = [];
    this.reverseFlowField = [];

    this.flowField = flowObj.flowField();
    this.reverseFlowField = reverseFlowObj.flowField();

    this.b2dSteerImp.setFlowField(this.flowField);
    this.b2dSteerImp.setReverseFlowField(this.reverseFlowField);

    if(browserVer) {
        updateWeightsAndFieldVisuals();
    }
};

cr.MyWorld.prototype.winLose = function() {
    var hasUpBase = false;
    var hasDownBase = false;
    var upBaseLeft = 0;
    var downBaseLeft = 0;
    var result = {"win":0, "upk":0, "dnk":0};  //0: up win 1:down win 2:even

    for (i = this.bases.length - 1; i >= 0; i--) {
        if(this.bases[i].objectId == 1 || this.bases[i].objectId == 2 || this.bases[i].objectId == 3) {
            upBaseLeft++;
        }
        if(this.bases[i].objectId == 4 || this.bases[i].objectId == 5 || this.bases[i].objectId == 6) {
            downBaseLeft++;
        }

        if(this.bases[i].objectId == 1) {
            hasUpBase = true;
        }
        else if(this.bases[i].objectId == 4) {
            hasDownBase = true;
        }
    }

    result.upk = 3-upBaseLeft;
    result.dnk = 3-downBaseLeft;

    //when timeout call.
    if(!this.isStart) {
        console.log("up:" + upBaseLeft + "|||" + "down:"+ downBaseLeft);
        if(upBaseLeft>downBaseLeft) {
            result.win=0;
        }
        else if(upBaseLeft<downBaseLeft) {
            result.win=1;
        }
        else {
            result.win=2;
        }
        this.sendResult(result);
        return;
    }

    if(hasUpBase && !hasDownBase) {
        this.isStart = false;
        console.log("up win.");
        result.win=0;
        //if down base destroied, then upper destroy 3 base.
        result.dnk = 3;
        this.sendResult(result);
        return;
    }
    else if(!hasUpBase && hasDownBase) {
        this.isStart = false;
        console.log("down win.");
        result.win=1;
        result.upk = 3;
        this.sendResult(result);
        return;
    }
    else if(!hasUpBase && !hasDownBase) {
        this.isStart = false;
        console.log("both bases were destroyed.")
        result.win=2;
        result.dnk = 3;
        result.upk = 3;
        this.sendResult(result);
        return;
    }
};

