//called periodically to update the game
//dt is the change of time since the last update (in seconds)
cr.MyWorld.prototype.gameTick = function (dt, emitCounter) {
    var i, agent;
    var enemy;
    var ff;
    var delAgentsRec = [];
    var delBulletsRec = [];
    var delFortsRec = [];
    var delBasesRec = [];
    var delLogsRec = [];


    //rolling log kill
    var contactList = this.world.GetContactList();
    var userA,userB;
    for (var contact = contactList; contact; contact = contact.GetNext() ) {
        userA = contact.GetFixtureA().GetBody().GetUserData();
        userB = contact.GetFixtureB().GetBody().GetUserData();

        //only detect that agent collide with log.
        if (contact.IsTouching() && userA && userB) {   // 接触只代表AABB重合 但不代表形体碰撞
            // if one side is rolllog and other side is agent
            // 12 rolllog chartype ,1 agent char type
            if(userA.charType==12 && userB.charType==1) {
                console.log("--111-contact----");
                userB.lifeVal -= this.logKillVal;
            }
            if(userA.charType==1 && userB.charType==12) {
                console.log("--222-contact----");
                userA.lifeVal -= this.logKillVal;
            }
        }
    }

    for(i = this.rollLogs.length - 1; i >= 0; i--) {
        //if log collide to sth, it would bounch off and miss direction, if so, kill the log.
        if(!this.rollLogs[i].isHero) {
            if(this.rollLogs[i].body && (this.rollLogs[i].body.m_linearVelocity.y<=1 || Math.abs(this.rollLogs[i].body.m_linearVelocity.x)>0.1)) {
                console.log("rolling log destroyed, should send to client");
                this.rollLogs[i].destroy();
                this.rollLogs[i].setLife(0);
                delLogsRec.push(i);
            }
        } else {
            if(this.rollLogs[i].body && (this.rollLogs[i].body.m_linearVelocity.y>=-1 || Math.abs(this.rollLogs[i].body.m_linearVelocity.x)>0.1)) {
                console.log("rolling log destroyed, should send to client");
                this.rollLogs[i].destroy();
                this.rollLogs[i].setLife(0);
                delLogsRec.push(i);
            }           
        }
    }

    //agent dead
    for (i = this.agents.length - 1; i >= 0; i--) {
        agent = this.agents[i];
        if(agent.getLife() <= 0) {
            agent.destroy();
            delAgentsRec.push(i);
        }
    }

    //agent dead
    for (i = this.bullets.length - 1; i >= 0; i--) {
        agent = this.bullets[i];
        if(agent.getLife() <= 0) {
            agent.destroy();
            delBulletsRec.push(i);
        }
    }

    //fort dead
    for (i = this.forts.length - 1; i >= 0; i--) {
        agent = this.forts[i];
        if(agent.getLife() <= 0) {
            agent.destroy(this.flowField, this.reverseFlowField);
            delFortsRec.push(i);
            if(browserVer) {
                updateWeightsAndFieldVisuals();
            }
        }
    }

    //base dead
    for (i = this.bases.length - 1; i >= 0; i--) {
        agent = this.bases[i];
        if(agent.getLife() <= 0) {
            agent.destroy();
            delBasesRec.push(i);
        }
    }

    //for createjs display
    for(i = 0; i < delAgentsRec.length; i++) {
        this.agents.splice(delAgentsRec[i], 1);   
    }

    for(i = 0; i < delBulletsRec.length; i++) {
        this.bullets.splice(delBulletsRec[i], 1);   
    }

    for(i = 0; i < delFortsRec.length; i++) {
        this.forts.splice(delFortsRec[i], 1);     
    }

    for(i = 0; i < delBasesRec.length; i++) {
        this.bases.splice(delBasesRec[i], 1);     
    }

    for(i = 0; i < delLogsRec.length; i++) {
        this.rollLogs.splice(delLogsRec[i], 1);     
    }

    //if win&lose stop the game.
    this.winLose();

    if(!this.isStart) {
        clearInterval(this.steerTimer);
        return;
    }

    //since base destroied, flow map should regenerata
    if(delBasesRec.length > 0) {
        this.regenMapFlow();

        //default map flow is not including fort flow(base only), so if forts removed, flow should merge into map flow.
        for(fort of this.forts) {
            fort.regenFlow(this.flowField, this.reverseFlowField);
        }

        //if one base destroied, all agent need to be checked to see if its destination changed.
        for(agent of this.agents) {
            agent.setNextBaseDestination(this.bases); 
        }

        if(browserVer) {
            updateWeightsAndFieldVisuals();
        }
    }

    //Calculate steering and flocking forces for all agents
    for (agent of this.forts) {
        agent.attack();
    }

    //Calculate steering and flocking forces for all agents
    for (agent of this.agents) {
        //Attack enemies
        agent.attack(dt);

        //Move agents based on forces being applied (aka physics)
        agent.move(dt);
    }

    //Calculate steering and flocking forces for all agents
    for (agent of this.bases) {
        agent.attack();
    }

    for (agent of this.bullets) {
        //Move bullets based on forces being applied (aka physics)
        agent.move(dt);
    }

    if(!this.isStart) {
        clearInterval(this.steerTimer);
        return;
    }

    this.world.Step(dt, 10, 10);
    this.world.ClearForces();
};

